import React, { useState } from 'react';
import { Container } from './style';

type user = {
  name: string
}

const User = (user: user) => {
	return (
		<Container>
			<span>{user.name}{}</span>
			<button>Contar +1</button>
		</Container>
	);
};

export default User;
